visuals.description:
*사각형 값에 fill 2번째 값을 왜 주는지 드디어 이해.

1.계속 배경을 쌓아 뒤에 있는 도형이 가려지면서 그라데이션이 그려짐.
2. dx와 dy값은 원을 일차함수 그래프처럼 움직이게 한다
따라서 dx 값이 커지면 버블은 가로로 쌓이게 되고, dy 값이 커지면 세로로 쌓인다. 또한 수 자체가 커질경우 원의 이동속도가 빨라진다.
3. 근데 boolean isOut() {
    if (x&lt;0 || x&gt;width || y&lt;0 || y&gt;height) {
      return true;
    } else {
      return false;
    }
  } 아직 이부분은 이해가 잘 안감, 아무래도 원 제거와 관련된 부분인것 같은데 잘 모르겠다. -&gt; 이해함// 참일경우 함수 작동 -&gt; 본 코드에서 제거함수 작동.

4. 어레이 리스트는 무한 반복되는 기능, 
클라스로 개체 이름 정해서 지정해주고나서, 바로 밑에 쌓아두면 작동함. 
5. 여전히 float int 혼동된다.

